import Logo from '../../components/logo/logo'
import './homepage.css'

const HomePage = () => {
    return (
        <div className='home'>
            <Logo />
            <span>
                <b>AI Based Comment Analyzation Tool</b>
            </span>
        </div>
    )
}

export default HomePage;
